@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'interest-rate-frontend';
}
<h1 style="text-align: center;">Interest Rate Dashboard</h1>
<div style="padding: 20px;">
  <app-rate-form></app-rate-form>
  <hr>
  <app-rate-list></app-rate-list>
</div>
